from typing import Optional, List

from collections import defaultdict

class Solution:

    def setFromString(self, s):
      letters = defaultdict(lambda: 0)
      for x in s:
        letters[x] += 1
      return letters

    def checkInclusion(self, s1: str, s2: str) -> bool:
      letters = self.setFromString(s1)
      
      perm_len = len(s1)
      subagg = defaultdict(lambda: 0)
      agg_count = 0

      for i in range(0,len(s2)):
        a = s2[i]

        subagg[a] += 1
        agg_count += 1

        if agg_count > perm_len:
          b = s2[i - perm_len]
          subagg[b] -= 1
          if not subagg[b]:
            del subagg[b]
          agg_count -= 1

        if letters == subagg:
          return True
      
      return False

def test(s1, s2, e):
  a = Solution().checkInclusion(s1,s2)
  print(f"{s1[0:10]} {s2[0:10]} => {a} == {e}")

test("ab","a", False)
test("ab","ab", True)
test("ab","ba", True)
test("ab","eidbaooo", True)
test("ab","eidboaoo", False)
test("adc","dcda", True)
test("","", False)